import Login from '..containers/Login';
import Register from '../containers/Register';
import Home from '../containers/Home';




const routes= [

    {
        path: "/auth/login",
        component: Login,
        title:'login'
    },

    {
        path: "/auth/register",
        component: Register,
        title:'register'
    },

    {
        path: "/",
        component: Home,
        title:'home'
    },
];

export default routes;;
